        }

        public function getTheme(string $name): array
        {
            return $this->defaultThemes[$name];
        }

        public function getThemeDefaultImages(string $name): array
        {
            $theme = self::getTheme($name)['styles'];
            $result = [];

            foreach ($theme as $item) {
                $colors = unserialize($item['colors']);
                $result[$item['slug']] = $colors['image']['defaultImage'];
            }

            return $result;
        }

        public function getThemes(): array
        {
            return $this->defaultThemes;
        }

        public function getThemesInfo(): array
        {
            return array_map(fn($theme): array => [
                'name' => $theme['name'],
                'slug' => $theme['slug'],
                'description' => $theme['description'],
                'image' => STB_URL . 'images/themes/' . $theme['slug'] . '-theme.jpg'
            ],
                [$this->stbRetro, $this->stbDark, $this->stbLight, $this->stbMetro]
            );
        }

        public function getThemesNames(): array
        {
            return array_map(
                fn($theme): string => $theme['slug'],
                [$this->stbRetro, $this->stbDark, $this->stbLight, $this->stbMetro]
            );
        }
    }
